import React, { useEffect, useRef } from 'react';
import styled from 'styled-components';

const AboutContainer = styled.section`
  min-height: 100vh;
  background: var(--color-background);
  position: relative;
  overflow: hidden;
  padding: 8rem 2rem;
  color: var(--color-text-primary);
  display: flex;
  align-items: center;
`;

const Section = styled.div`
  max-width: 980px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 4rem;
  align-items: center;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
    gap: 2rem;
  }
`;

const Content = styled.div`
  opacity: 0;
  transform: translateX(-50px);
  animation: fadeInRight 1s ease forwards;

  @keyframes fadeInRight {
    to {
      opacity: 1;
      transform: translateX(0);
    }
  }
`;

const Title = styled.h2`
  font-size: 3.5rem;
  font-weight: 700;
  margin-bottom: 2rem;
  letter-spacing: -0.02em;
  line-height: 1.1;
  color: var(--color-text-primary);

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const Description = styled.p`
  font-size: 1.2rem;
  line-height: 1.8;
  color: var(--color-text-secondary);
  margin-bottom: 2rem;
`;

const ImageGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1rem;
  opacity: 0;
  transform: translateX(50px);
  animation: fadeInLeft 1s ease forwards;

  @keyframes fadeInLeft {
    to {
      opacity: 1;
      transform: translateX(0);
    }
  }
`;

const Image = styled.img`
  width: 100%;
  height: 200px;
  object-fit: cover;
  border-radius: 12px;
  transition: transform 0.3s ease;

  &:hover {
    transform: scale(1.05);
  }
`;

const StatsContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  margin-top: 3rem;
  opacity: 0;
  transform: translateY(30px);
  animation: fadeInUp 1s ease forwards 0.5s;

  @keyframes fadeInUp {
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const Stat = styled.div`
  text-align: center;
  padding: 2rem;
  background: var(--color-background);
  border-radius: 12px;
  border: 1px solid var(--color-border);
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-10px);
    border-color: var(--color-accent);
  }
`;

const StatNumber = styled.div`
  font-size: 3rem;
  font-weight: 700;
  color: var(--color-accent);
  margin-bottom: 1rem;
`;

const StatLabel = styled.div`
  font-size: 1.1rem;
  color: var(--color-text-secondary);
`;

const About: React.FC = () => {
  const containerRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    const container = containerRef.current;
    if (!container) return;

    const handleScroll = () => {
      const { top } = container.getBoundingClientRect();
      const windowHeight = window.innerHeight;
      
      if (top < windowHeight * 0.8) {
        container.style.opacity = '1';
        container.style.transform = 'translateY(0)';
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <AboutContainer id="about" ref={containerRef}>
      <Section>
        <Content>
          <Title>About Us</Title>
          <Description>
            We are a team of passionate developers, designers, and innovators dedicated to creating exceptional digital experiences. Our mission is to help businesses thrive in the digital age through cutting-edge technology and creative solutions.
          </Description>
          <StatsContainer>
            <Stat>
              <StatNumber>10+</StatNumber>
              <StatLabel>Years Experience</StatLabel>
            </Stat>
            <Stat>
              <StatNumber>100+</StatNumber>
              <StatLabel>Projects Completed</StatLabel>
            </Stat>
            <Stat>
              <StatNumber>50+</StatNumber>
              <StatLabel>Happy Clients</StatLabel>
            </Stat>
          </StatsContainer>
        </Content>
        <ImageGrid>
          <Image src="https://images.unsplash.com/photo-1522071820081-009f0129c71c?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" alt="Team Collaboration" />
          <Image src="https://images.unsplash.com/photo-1552664730-d307ca884978?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" alt="Office Space" />
          <Image src="https://images.unsplash.com/photo-1551434678-e076c223a692?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" alt="Team Meeting" />
          <Image src="https://images.unsplash.com/photo-1522202176988-66273c2fd55f?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" alt="Project Planning" />
        </ImageGrid>
      </Section>
    </AboutContainer>
  );
};

export default About;
